import React from 'react';
import { BrowserRouter, Route, Link } from 'react-router-dom';

const PageOne = () => {
    return (
        <div>
            Page one
            <Link to="/pagetwo">to page 2</Link>
        </div>
    );
};

const PageTwo = () => {
    return (
        <div>
            Page two
            <button>Click</button>
            <Link to="/">to page 1</Link>
        </div>
    );
}

const App = () => {
    return (
        <div>
            <BrowserRouter>
            <div>
                <Route path="/" exact component={PageOne} />
                <Route path="/pagetwo" exact component={PageTwo} />
            </div>
            </BrowserRouter>
        </div>
    );
};
export default App;
